import img from "../Slide/app.json"

export default function Videos() {
    return (
        <iframe className="d-block w-100 h-100" src="./oi.mp4" title="description"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; 
          picture-in-picture; web-share; autoplay" sandbox='sandbox'
        referrerPolicy='no-referrer'
        allowfullscreen
      ></iframe>

    )
}
